// client/src/components/Contact.js
import React from 'react';

const Contact = () => {
  return (
    <div className="page-container">
      <div className="hero">
        <h1>Contact Us</h1>
        <p>Get in touch with the Nexus AI team</p>
      </div>
    </div>
  );
};

export default Contact;
